import { Component } from '@angular/core';

@Component({
  selector: 'app-lots',
  templateUrl: './lots.component.html',
  styleUrls: ['./lots.component.css']
})
export class LotsComponent {

}
<img src="./../../../assets/lots.gif" alt="a map of available lots" class="ml-10">
<button type="button" class="md:hidden rounded-t-md rounded-l-md rounded-r-md">View Lots</button>
